//SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract game{
  string gameType;
  string gameTier;
  uint256 gameStatus = 0;
  address payable feeWallet;



  mapping (address => uint256) public addressToTicketAmount;
  mapping (address => uint256) public winnerToTime;
  mapping (address => uint) public winnerPos;
  mapping (address => uint256) public playerStartTime;

//Players Array
address[]  public players;
address[]  public winners;


//THE CONSTRUCTOR THAT IS INVOKED WHITE CREATING A NEW CAMPAIGN
  constructor (
    string memory _gameType, 
    string memory _gameTier,
    address payable _feeWallet) {
        gameType = _gameType;
        gameTier = _gameTier;
        feeWallet = _feeWallet;
}

function viewGameDetails () external view returns (string memory,string memory,uint256,uint256,uint256){
return (gameType,gameTier,address(this).balance,players.length,gameStatus);
}


function buyTicket() external payable{
  require (msg.value > 0,"Spend More Tokens");
  uint256 playerStatus = checkPlayer(msg.sender);
  require (playerStatus == 0, "You already have a ticket");
  players.push(msg.sender);
  addressToTicketAmount[msg.sender] += msg.value;

}

function checkPlayer(address _address) public view returns (uint256) {

return addressToTicketAmount[_address] ;
}

function setGameFinishTimes(address player, uint256 time) external {
winnerToTime[player] += time;
uint winnerCount = winners.length;
//uint newWinnerPos = winnerCount+1;
winnerPos[player]+= winnerCount+1;
//set game to terminal status immediately when the firt player completes it
if (gameStatus == 1){
setGameStatus(2);
}
}

function setGameStartTime(address player, uint256 time) external {
playerStartTime[player] += time;
//set game status to 1 only once
if (gameStatus == 0){
setGameStatus(1);
}

}

function setGameStatus(uint256 _status) public {
gameStatus = _status;
}

function transferFee() external payable {

  require (gameStatus == 1, "Game is not started");
  uint256 fee = address(this).balance * 20/100;
  feeWallet.transfer (fee);

  }


function claimRewards() external payable {

  require (gameStatus > 1, "Game is Not Completed");

  }


}
